    false,nt"url": null,nt"notes": "This metadata describes the digital orthoimagery
    covering the area of the Everglades in Monroe County, FL as defined by the FL DOR.
    This 1"=100' scale imagery is comprised of natural color (RGB) and color infrared
    (CIR) orthoimagery with a GSD (Ground Sample Distance) of 1.0'. Imagery was collected
    primarily with the Leica ADS40 digital sensor and processed with Leica GPro software.
    One flight line was collected with a Vexcel Ultracam X digital airborne sensor and
    processed with Waypoint Inertial Explorer software. Imagery is projected in State
    Plane Coordinate System, Florida East using the Transverse Mercator map projection
    parameters.",nt"license_title": null,nt"extras": [{ntt"key": "responsible-party",ntt"value":
